export const getAboutData = async () => {
  try {
    const response = await fetch('/api/about');
    if (!response.ok) {
      throw new Error(`HTTP error! status: ${response.status}`);
    }
    return await response.json();
  } catch (error) {
    console.error('Service error:', error);
    throw error;
  }
};
